column8:
雨の日もドライブが楽しくなる！<br> <br> <br>スプレータイプの撥水型ガラスクリーナー。<br>窓ふきするだけで水ハジキコーティングも同時に完了。<br>車内側の汚れ取りにも使え、汚れの固着を防止できます！<br>梅雨対策にも最適！<br><br><br><br>●内容量：330ml<br><br>●メーカー品番：コードNo.04144<br>●メーカー：ソフト99 SOFT99<style type="text/css">
