従来の約6倍の寿命を実現した超持続性ガラスコーティング剤です。<br><br>
1回の使用で約1年間※撥水効果が持続。
<br>最新技術のフッ素処理(PAT-P)によって、ワイピングの摩擦や砂塵、洗車、洗剤にも耐える強力な被膜を維持します。
