ボトル部分が長く、取っ手として使えるので、今まで手が届きにくく、塗りにくかったフロントガラスのセンター部や上部も、ラクラク塗り込めます。<br>

さらに薄い角型ヘッドで、バイザーの下などの細かい部分も塗りやすくなっています。<br>

1度塗れば、長期間にわたって撥水効果が持続しますので、「耐久性」を重視する方におすすめです。<style type="text/css">
