ウォッシャーしてワイピングするだけで強力撥水。瞬時にクリアーな視界を確保できます。<br><br>

パウチパックを採用することで、樹脂ボトルと比較し、プラスチック使用量を約80％削減。<br>
ゴミの量を体積比約1/5、重量比約1/6に大幅に削減します。使用後は容器をコンパクトに圧縮できるため、廃棄の際にかさばりません。<br><br>
また、容器原料生産時と使用済みの容器の焼却処分時に大幅なＣＯ２削減を実現、地球環境保全に貢献します。<style type="text/css">
